import React from "react";
import { Col, Container, Row } from "react-bootstrap";
import AtheProfileLayout from "../../components/layout/AtheProfileLayout";

const EditProfile = () => {
  const formfields = [
    [{ label: "First Name", value: "John" }],
    [
      { label: "Surname", value: "Doe" },
      { label: "City", value: "Example City" },
    ],
    [{ label: "State", value: "Example State" }],
    [{ label: "Date of Birth", value: "01/01/1990" }],
  ];
  return (
    <AtheProfileLayout>
      <h4>Edit Profile</h4>
      <Container>
        <h5>Personal</h5>
        {formfields.map((row, rowIndex) => (
          <Row key={rowIndex}>
            {row.map((field, colIndex) => (
              <Col key={colIndex}>
                <strong>{field.label}:</strong> {field.value}
              </Col>
            ))}
          </Row>
        ))}
      </Container>
    </AtheProfileLayout>
  );
};

export default EditProfile;
